import './App.css';

function App() {
  return (
    <>
      <Header />
      <div className="App">
        <p>This should just be plain text.</p>
      </div>
    </>
  );
}

function Header() {
  return (
  <>
  <section id="header">
    <div id="name-wrapper">John Collins</div>
  </section>
  </>
  );
}

export default App;
